import React from 'react';
import {useQuery} from 'react-query';

const fetchPlanets = async () => {
  const res = await fetch('http://swapi.dev/api/planets/');
  return res.json();
}

const Planets = () => {
  const {} = useQuery('planets', fetchPlanets);
  return (
    <div>
      <h2>Planets</h2>
    </div>
  )
}

export default Planets;
